import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Minesweeper from './minesweeper/Minesweeper';

ReactDOM.render(
  <React.StrictMode>
    <center><h1>Tyler's Minesweeper (Made in React)</h1></center>    
    <Minesweeper size={10} mines={1} />
    <center><button onClick={() => window.location.reload(false)}>Click to reload!</button></center>
  </React.StrictMode>,
  document.getElementById('root')
);
